pragma solidity ^0.4.25;

import "./Interfaces.sol";
import "./Helpers.sol";
import "./Enums.sol";

import "./WildaloERC721.sol";

import "./Libs.sol";

contract Auction is IAuction, Shared,
    UsingWildaloERC721,
    ERC721Receiver,
    UsingSettings,
    UsingEnums {

    using SafeMath for uint256;
    using CardByteModifier for uint256;

    struct Auction {
        address owner;
        uint256 currency;
        uint256 cardId;
        uint256 createdTime;
        uint256 startPrice;
        uint256 endPrice;
        uint256 duration;
    }

    //cardId -> Auction
    mapping(uint256 => Auction) auctions;

    function getAuctionInfo(uint256 _cardId) public view
        returns (address, uint256, uint256, uint256, uint256, uint256) {
        require(auctions[_cardId].cardId == _cardId && _cardId != 0);
        address owner = auctions[_cardId].owner;
        uint256 currency = auctions[_cardId].currency;
        uint256 createdTime = auctions[_cardId].createdTime;
        uint256 startPrice = auctions[_cardId].startPrice;
        uint256 endPrice = auctions[_cardId].endPrice;
        uint256 duration = auctions[_cardId].duration;
        return (owner, currency, createdTime, startPrice, endPrice, duration);
    }

    function getOwnerOfAuctionFromCardId(uint256 _cardId) public view returns (address) {
        require(auctions[_cardId].cardId == 0 && _cardId != 0);
        return auctions[_cardId].owner;
    }

    function _addAuction(
        address _owner,
        uint256 _currency,
        uint256 _cardId,
        uint256 _startPrice,
        uint256 _endPrice,
        uint256 _duration
    ) internal {
        // daha once uretilmemis ve 0 ile uretilemesin.
        require(auctions[_cardId].cardId == 0 && _cardId != 0);

        auctions[_cardId].owner = _owner;
        auctions[_cardId].currency = _currency;
        auctions[_cardId].cardId = _cardId;
        auctions[_cardId].createdTime = now;
        auctions[_cardId].startPrice = _startPrice;
        auctions[_cardId].endPrice = _endPrice;
        auctions[_cardId].duration = _duration;
    }

    function _removeAuction(address _owner, uint256 _cardId) internal {
        //silinecek kardin sahibi kendisi olmali.
        require(auctions[_cardId].owner == _owner);
        delete auctions[_cardId];
    }

    //note: bu metodun cagrildigi yerde cagiran approve yapmali
    function createAuction(
        address _owner,
        uint256 _currency,
        uint256 _cardId,
        uint256 _startPrice,
        uint256 _endPrice,
        uint256 _duration
    ) __onlyShared public {
        //is owner of card
        require(nft.ownerOf(_cardId) == _owner);

        _addAuction(_owner, _currency, _cardId, _startPrice, _endPrice, _duration);
        nft.safeTransferFrom(_owner, address(this), _cardId);
    }

    function cancelAuction(address _owner, uint256 _cardId) __onlyShared public {
        _removeAuction(_owner, _cardId);
        nft.approve(_owner, _cardId);
    }

    function bid(address _bidder, uint256 _cardId) __onlyShared public {
        address owner = auctions[_cardId].owner;
        _removeAuction(owner, _cardId);
        nft.approve(_bidder, _cardId);
    }

    function getAuctionInfoForBid(uint256 _cardId) 
        public view
        returns (address, uint256, uint256)
    {
        //TODO: control EAuction is exists + method.

        int256 secondsPassed = int256(now) -
            int256(auctions[_cardId].createdTime);
        int256 startPrice = int256(auctions[_cardId].startPrice);
        int256 endPrice = int256(auctions[_cardId].endPrice);
        int256 duration = int256(auctions[_cardId].duration);
        if (secondsPassed >= duration) {
            secondsPassed = duration;
        }

        // Starting price can be higher than ending price (and often is!), so
        // this delta can be negative.
        int256 totalPriceChange = endPrice - startPrice;

        // This multiplication can't overflow, _secondsPassed will easily fit within
        // 64-bits, and totalPriceChange will easily fit within 128-bits, their product
        // will always fit within 256-bits.
        int256 currentPriceChange = (totalPriceChange * secondsPassed) /
            duration;

        // currentPriceChange can be negative, but if so, will have a magnitude
        // less that _startingPrice. Thus, this result will always end up positive.
        int256 currentPrice = startPrice + currentPriceChange;

        return (auctions[_cardId].owner, uint256(currentPrice), auctions[_cardId].currency);

    }
}
